import React from "react";
import { Sidebar } from 'primereact/sidebar';
import AccountStyle from "../../styles/Account/Account.css";
import { Avatar } from 'primereact/avatar';
import IconButton from '@mui/joy/IconButton';


const { SideBar, ContainerAccount, ContainerImg, AboutMe, ContainerAbout } = AccountStyle

function Account() {

    return (
        <ContainerAccount>
            <SideBar>
                <Avatar label="U" size="xlarge" style={{ backgroundColor: '#9c27b0', color: '#ffffff' }} />
                <Button icon="pi pi-times" rounded severity="danger" aria-label="Cancel" />
            </SideBar>
            <ContainerAbout>
                <ContainerImg>
                    <img src={require('../../imgs/IMG_0039.heic')} alt="" />
                </ContainerImg>
                <AboutMe>Lorem ipsum dolor sit amet consectetur adipisicing elit. Dignissimos, iste ipsam. Sit fugit iure sed provident perspiciatis eos a accusamus, aspernatur eius ipsam quaerat ratione adipisci. Labore, quam! Voluptate, eum.</AboutMe>
            </ContainerAbout>

        </ContainerAccount>
    )
}

export default Account
